import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Asistance from './views/Asistance';
import EditModule from './views/EditModule';
import LeftSidebar from './views/LeftSideBar';
import NewModule from './views/NewModule';
import Login from './views/Login';
import CentralContent from './views/CentralContent';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="*" element={
          <div className="flex items-center h-screen">
            <LeftSidebar />
            <Routes>
              <Route path="/" element={<CentralContent />} />
              <Route path="/asistencia" element={<Asistance />} />
              <Route path="/editar-modulo" element={<EditModule />} />
              <Route path="/nuevo-modulo" element={<NewModule />} />
            </Routes>
          </div>
        } />
      </Routes>
    </Router>
  );
};

export default App;
